import React from "react";
import { render } from "@testing-library/react";

function FrontCard(props) {
  return (
    <div class={props.cardclass}>
      <div class="signup-text">
        <p>{props.text1}</p>
        <p>{props.text2}</p>
        <p>{props.text3}</p>
      </div>
      <div class="card2-img">
        <img id = "card-img" src={props.imgpath} alt="" />
      </div>
    </div>
  );


}

export default FrontCard;
